parseNumericIDsToStr.code:
function parseNumericIDsToStr(bodyJSONstr) {
	if (!bodyJSONstr) return;
	if (typeof bodyJSONstr !== 'string') throw TypeError('"body" is expected to be a string.');

    let jsonBody = bodyJSONstr;

    const keysStr = jsonBody.split(',');
    const pattern = /".*id":\d+/;
    keysStr.forEach((i) => {
        const match = i.match(pattern);

        if (!match) return;

        const matchedStr = match[0];
        const patternForId = /\d+/;

        const matchedId = matchedStr.match(patternForId);

        if (!matchedId) return;

        const strForReplace = matchedId.input.replace(
            matchedId[0],
            `"${matchedId[0]}"`
        );

        jsonBody = jsonBody.replace(matchedId.input, strForReplace);
    });

    return JSON.parse(jsonBody);
}

parseNumericIDsToStr.test:
it('returns "undefined" if "body" is a falsy value', () => {
    assert.deepEqual(parseNumericIDsToStr(false), undefined);
});

it('throws TypeError if "body" is not a string', () => {
    assert.throws(() => {
        parseNumericIDsToStr(123213);
    }, TypeError);
});

it('transforms all the numbers next to the keys that have "id" in the name to strings', () => {
    const input = `{"request_id":1793321132227617,"object":1,"entry":[{"id":7345449721550405889,"page_id":7081644712976744706,"page_name":"Untitled Form4/1/22, 4:41 PM","campaign_id":0,"campaign_name":"test lead: dummy data for campaign name","adgroup_id":0,"adgroup_name":"test lead: dummy data for ad group name","ad_id":0,"ad_name":"test lead: dummy data for ad name","create_time":1710246906,"changes":[{"field":"name","value":"Jane Doe"},{"field":"email","value":"test_email_address@mail.com"}]}],"time":1710246906}`;
    const expectedStr = `{"request_id":"1793321132227617","object":1,"entry":[{"id":"7345449721550405889","page_id":"7081644712976744706","page_name":"Untitled Form4/1/22, 4:41 PM","campaign_id":"0","campaign_name":"test lead: dummy data for campaign name","adgroup_id":"0","adgroup_name":"test lead: dummy data for ad group name","ad_id":"0","ad_name":"test lead: dummy data for ad name","create_time":1710246906,"changes":[{"field":"name","value":"Jane Doe"},{"field":"email","value":"test_email_address@mail.com"}]}],"time":1710246906}`;
	const expectedJSON = JSON.parse(expectedStr);

    assert.deepStrictEqual(parseNumericIDsToStr(input), expectedJSON);
});

addMappableAnswersToResponse.code:
function addMappableAnswersToResponse(payload, pageId) {
    if (!pageId) return payload;

    if (!payload) return payload;
    if (typeof payload !== 'object') return payload;
    if (!payload.hasOwnProperty('entry')) return payload;
    if (!Array.isArray(payload.entry)) return payload;

    function buildMappableAnswers(changes) {
        return changes.reduce(
            (acc, c) => ({
                ...acc,
                [c.field]: c.value,
            }),
            {}
        );
    }

    return {
        ...payload,
        entry: payload.entry.map((e) => ({
            ...e,
            mappableAnswers: buildMappableAnswers(e.changes),
            changes: undefined,
        })),
    };
}

addMappableAnswersToResponse.test:
it('returns payload if it is a falsy value or the payload is not an object', () => {
    assert.strictEqual(addMappableAnswersToResponse(null), null);
    assert.strictEqual(addMappableAnswersToResponse(undefined), undefined);
    assert.strictEqual(
        addMappableAnswersToResponse('not an object'),
        'not an object'
    );
});

it('adds "mappableAnswers" object to each "entry" item where the key is taken from "entry[n].field" and the value is taken from "entry[n].value", and remove "changes" array from the "entry[n]".', () => {
    const changes = [
        {
            field: 'foo',
            value: 'bar',
        },
        {
            field: 'first_name',
            value: 'John',
        },
        {
            field: 'last_name',
            value: 'Doe',
        },
    ];

    const payload = {
        request_id: '13213213',
        entry: [
            {
                lead_id: '53213331',
                page_id: '51321133',
                changes,
            },
        ],
    };

    const mappableAnswers = {
        foo: 'bar',
        first_name: 'John',
        last_name: 'Doe',
    };

    const expectedOutput = {
        ...payload,
        entry: [
            {
                ...payload.entry[0],
                mappableAnswers,
                changes: undefined,
            },
        ],
    };

    assert.deepStrictEqual(
        JSON.stringify(addMappableAnswersToResponse(payload)),
        JSON.stringify(expectedOutput)
    );
});

buildMappableAnswersInterface.code:
function buildMappableAnswersInterface(fields) {
	if (!Array.isArray(fields)) return fields;

    const interface = fields.map((f) => ({
        label: iml.startcase(f),
        name: f,
        type: 'text',
    }));

    return interface;
}

buildMappableAnswersInterface.test:
it('returns "fields" if it is not an array', () => {
    assert.strictEqual(buildMappableAnswersInterface(1), 1);
});

it('returns interface object based on the field names received. all interfaces have "text" type', () => {
    const fields = ['foo', 'bar'];
    const interface = [
        {
            name: 'foo',
            label: 'Foo',
            type: 'text',
        },
        {
            name: 'bar',
            label: 'Bar',
            type: 'text',
        },
    ];

    assert.deepStrictEqual(buildMappableAnswersInterface(fields), interface);
});
